description:
A queer-focused podcast that touches on everything under the umbrella of the LGBTQIA+ community. Our guests include people from all walks of life from the straight community, queer community, drag queens, lesbians, gays, transgender men, transgender women, and everything in between. There are facts, opinions, questions, answers, unknowns, laughter, tears, tea, shade, Esmerelda's accent, and much more. 

Hosted by Canned Tina, Esmerelda Vergara, and Sarah Problem.
